import { useEffect, useState } from "react";

const Users = () => {
    let [user,setUser]=useState()

    useEffect(()=>{
        let fetchData=async()=>{
            let response = await fetch("http://localhost:4000/books")
            let data = await response.json()
            setUser(data)
            }
            fetchData()


    })
    return ( 
        <div className="users">
            <h1>Users Details</h1>
            h1{data.fir}
            

        </div>
     );
}
 
export default Users;
